enum FloatVal<'a> {
    Nan {
            val: Option<u64>,
            negative: bool,
        },
    Inf {
            negative: bool,
        },
    Val {
            hex: bool,
            integral: Cow,
            decimal: Option<Cow>,
            exponent: Option<Cow>,
        },
}

enum WastDirective<'a> {
    Wat(QuoteWat),
    AssertMalformed {
            span: Span,
            module: QuoteWat,
            message: &'a str,
        },
    AssertInvalid {
            span: Span,
            module: QuoteWat,
            message: &'a str,
        },
    Register {
            span: Span,
            name: &'a str,
            module: Option<Id>,
        },
    Invoke(WastInvoke),
    AssertTrap {
            span: Span,
            exec: WastExecute,
            message: &'a str,
        },
    AssertReturn {
            span: Span,
            exec: WastExecute,
            results: Vec<AssertExpression>,
        },
    AssertExhaustion {
            span: Span,
            call: WastInvoke,
            message: &'a str,
        },
    AssertUnlinkable {
            span: Span,
            module: Wat,
            message: &'a str,
        },
    AssertException {
            span: Span,
            exec: WastExecute,
        },
}

enum WastExecute<'a> {
    Invoke(WastInvoke),
    Wat(Wat),
    Get {
            module: Option<Id>,
            global: &'a str,
        },
}

enum QuoteWat<'a> {
    Wat(Wat),
    QuoteModule(Span, Vec<(Span, &'a [u8])>),
    QuoteComponent(Span, Vec<(Span, &'a [u8])>),
}

enum CustomPlace {
    BeforeFirst,
    Before(CustomPlaceAnchor),
    After(CustomPlaceAnchor),
    AfterLast,
}

enum FuncKind<'a> {
    Import(InlineImport),
    Inline {
            locals: Vec<Local>,
            expression: Expression,
        },
}

enum MemoryKind<'a> {
    Import {
            import: InlineImport,
            ty: MemoryType,
        },
    Normal(MemoryType),
    Inline {
            is_32: bool,
            data: Vec<DataVal>,
        },
}

enum DataKind<'a> {
    Passive,
    Active {
            memory: Index,
            offset: Expression,
        },
}

enum TableKind<'a> {
    Import {
            import: InlineImport,
            ty: TableType,
        },
    Normal(TableType),
    Inline {
            elem: RefType,
            payload: ElemPayload,
        },
}

enum ElemKind<'a> {
    Passive,
    Declared,
    Active {
            table: Index,
            offset: Expression,
        },
}

enum ElemPayload<'a> {
    Indices(Vec<Index>),
    Exprs {
            ty: RefType,
            exprs: Vec<Expression>,
        },
}

enum MemoryType {
    B32 {
            limits: Limits,
            shared: bool,
        },
    B64 {
            limits: Limits64,
            shared: bool,
        },
}

enum CoreAliasTarget<'a> {
    Export {
            instance: Index,
            name: &'a str,
            kind: ExportKind,
        },
    Outer {
            outer: Index,
            index: Index,
            kind: CoreOuterAliasKind,
        },
}

enum AliasTarget<'a> {
    Export {
            instance: Index,
            name: &'a str,
            kind: ComponentExportAliasKind,
        },
    Outer {
            outer: Index,
            index: Index,
            kind: ComponentOuterAliasKind,
        },
}

enum NestedComponentKind<'a> {
    Import {
            import: InlineImport,
            ty: ComponentTypeUse,
        },
    Inline(Vec<ComponentField>),
}

enum FuncKind<'a> {
    Import {
            import: InlineImport,
            ty: ComponentTypeUse,
        },
    Lift {
            ty: ComponentTypeUse,
            info: CanonLift,
        },
    Alias(InlineExportAlias),
}

enum CanonicalFuncKind<'a> {
    Lift {
            ty: ComponentTypeUse,
            info: CanonLift,
        },
    Lower(CanonLower),
}

enum CoreInstanceKind<'a> {
    Instantiate {
            module: ItemRef,
            args: Vec<CoreInstantiationArg>,
        },
    BundleOfExports(Vec<CoreInstanceExport>),
}

enum InstanceKind<'a> {
    Import {
            import: InlineImport,
            ty: ComponentTypeUse,
        },
    Instantiate {
            component: ItemRef,
            args: Vec<InstantiationArg>,
        },
    BundleOfExports(Vec<ComponentExport>),
}

enum CoreModuleKind<'a> {
    Import {
            import: InlineImport,
            ty: CoreTypeUse,
        },
    Inline {
            fields: Vec<core::ModuleField>,
        },
}

enum ModuleTypeDecl<'a> {
    Type(core::Type),
    Alias(CoreAlias),
    Import(core::Import),
    Export(&'a str, core::ItemSig),
}

enum TypeDef<'a> {
    Defined(ComponentDefinedType),
    Func(ComponentFunctionType),
    Component(ComponentType),
    Instance(InstanceType),
}

enum InstanceTypeDecl<'a> {
    CoreType(CoreType),
    Type(Type),
    Alias(Alias),
    Export(ComponentExportType),
}
